import logo from './fotoLucas.png';
import './App.css';

function abrirPortfolioCompleto(){
  <div>Agora vcccc vai aprender mais sobre mim.</div>
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Bem vindo ao meu Portfolio!!! :)</h1>
        <p>Lucas da Costa</p>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Analista em Tecnologia da Informação
        </p>
        <a
          className="App-link"
          href="https://github.com/lucascostadevrobot"
          target="_blank"
          rel="noopener noreferrer"
        >
         Bora descobrir mais sobre mim?
        </a>
        {abrir}
      </header>
    </div>
  );
}

export default App;
